         var tmp = SVGDocument.getElementById("c"+IDS[i]);
         tmp.setAttribute("stroke-width", "0");
         var tmp2 = SVGDocument.getElementById("t"+IDS[i]);
         tmp2.setAttribute("fill", "black");
      }
